import React, { Component } from 'react';
import FadeIn from 'react-fade-in';

class ProjectCard extends Component {
    render() {
        return (
            <div class="projectCard">
                <FadeIn delay="500" transitionDuration="900">
                <div className="imageBox">
                    <a href={this.props.tolink} target="_blank"><img style={{ width: '20vw' }} src={this.props.source}></img></a>
                </div>
                </FadeIn>
                <FadeIn delay="1100" transitionDuration="900">
                <div className="imageTextBox" style={{ paddingLeft: '2vw', paddingTop: '.7vh' }}>
                    <h3 style={{ fontSize: '1.2vw' }}>{this.props.name} - <i>{this.props.tech}</i></h3>
                    <ul style={{ paddingLeft: '16px', fontSize: '1.2vw' }}>
                        <li>{this.props.firstPoint}</li>
                        <li>{this.props.secondPoint}</li>
                        <li>{this.props.thirdPoint}</li>
                    </ul>
                </div>
                </FadeIn>
            </div>
        )
    }
}

export default ProjectCard;
